/*jslint maxerr: 50, indent: 2 */
/*global jQuery:true */
/*jshint forin:true, noarg:true, noempty:true, eqeqeq:true, bitwise:true, strict:true, undef:true, curly:true, browser:true, jquery:true, indent:2, maxerr:50 */
(function () {
  'use strict';

  var EdgePopup = {};

  EdgePopup.f = {
    
    openPanel   : function () {
      (function ($) {
        $('#edgePopup').animate({'left' : '0px'}, 250);
        $('#edgePopupHandle').addClass('opened');
      }(jQuery));
    },
    
    closePanel  : function () {
      (function ($) {
        $('#edgePopup').animate({'left' : '-250px'}, 250);
        $('#edgePopupHandle').removeClass('opened');
      }(jQuery));
    },
    
    switchToTab : function (tabID) {
      (function ($) {
        var $tabToShow;
        $tabToShow = $(tabID);
        $('#edgePopup div.edgePopup-content').hide();
        $tabToShow.show();
      }(jQuery));
    }
  };

  EdgePopup.init = function () {
    (function ($) {
      $('html').removeClass('no-js');
      // if there is an active alert then hide the remove the last news item
      // (Hooking into li.clearfix here seems overly specific, but without it
      // admin users have issues because the criteria is triggered by the
      // contextual links dropdown for controlling blocks/views.)
      // KA 2013 - this should not be needed, as it is handled by the view
      //$('#edgePopup li.clearfix:gt(2)').remove();
      
      // KA 2013 -- however, there is an extra footer -- we really need to fix this.
      if($('#edgePopup-news').find('.view-empty').find('li').size() > 0){ 
        $('#edgePopup-news').find('.view-empty').siblings('.view-footer').hide(); 
      }
      
      
      // apply the pop-out behavior when mousing over the edge popup
      $('#edgePopup').hoverIntent({
        sensitivity : 7,
        interval : 1000,
        over : function () {
          EdgePopup.f.openPanel();
        },
        timeout : 1000,
        out : function () { 
          EdgePopup.f.closePanel();
        }
      });
      // Below is functionality to make the tab click-open able.
      // The issue we are running into (we believe) is that if you
      // CLICK to open and immediately move your mouse away, it is never
      // registering the Hover. So, it will never register that you have hovered
      // out, because it never registers that you hovered in.
      // How can we get it to register a hover so that if you click but have your mouse outside,
      // the thing will close?  Do we even want to?
      
      $('#edgePopupHandle').click(function() {
    		if ($('#edgePopupHandle').hasClass('opened')) {
      		EdgePopup.f.closePanel();
    		}
        else {
          EdgePopup.f.openPanel();
        }
	   });

      // apply the tab behaviors
      $('#edgePopupTabs a').each(function () {
        var $this, theTab;
        $this = $(this);
        theTab = $this.attr('href');
        $this.click(function (e) {
          EdgePopup.f.openPanel();
          $('#edgePopupTabs a.active').removeClass('active');
          $this.addClass('active');
          EdgePopup.f.switchToTab(theTab);
          e.preventDefault();
          this.blur();
          return false;
        });
      });
    }(jQuery));
  };

  jQuery(function () {
    EdgePopup.init();
  });
  
  
  window.onload = function () {
    (function ($) {
      if ($('body.front').length > 0) {
        EdgePopup.f.openPanel();
      }
    }(jQuery));
  };

}());;
